import React from 'react'
import styles from '../GalleryStyle.css'

const Cards = ({results}) => {
    
    let display;
    console.log(results)

    if(results){
        display = results.map(x=>{
            let {id , name , image , location , gender , species , status ,type } = x;
            return (
            <div key={id} className='col-4 text-light position-realtive' id='Character_Card'>
                <div className=''>
                    <img src={image} alt="" className="img-fluid" id="CardImage"/>
                    <div id="Cardblur"></div>
                    <div className='content'>
                        <div className="fs-5 fw-bold mb-2">{name}{status}</div>
                        <div className="mb-4">
                            <div className="fs-6 bg-dark fw-light text-light">{gender} - {species}</div>
                            <div className="fs-6 fw-light" >last seen in-<br></br><span className='fs-6 text-success fw-normal'>{location.name}</span></div>
                        </div>
                    </div>
                </div>
                <div className='badge bg-success position-absoulte' id = "status_badge">Alive</div>
            </div>
            );
        });
    }else{
        display = "404 - Not Found :("
    }
    return <> {display} </>;
}

export default Cards
